import { useState } from 'react';
import styled from 'styled-components';
import * as H from '../css/headerstyle'


 
const Header = () => {
    return (
        <>
            <H.Navbar>
                <H.MenuBars>
                    
                </H.MenuBars>
                <H.LogoWrapper>
                    DinerApp
                </H.LogoWrapper>
                <H.MenuNavbar>
                    <H.Atag> Contacto</H.Atag>
                    <H.Atag> Restaurantes</H.Atag>
                    <H.Atag> Bares</H.Atag>
                </H.MenuNavbar>
            </H.Navbar>
        </>
     );
}
 
export default Header;
